# root mean square formula
import math

X = [1, 1, 1, 1,  1, 1, inf]
Y = [1, 1,  1, 1, 1, 1, 1]
Z = [1, 3,  8, 0,  0, 0, 1]


# Source: https://python.tutorialink.com/determine-the-similarity-between-two-arrays-of-counts-closed/
# the closer to zero root mean square is the more similar two arrays are
def similariy(array_1,array_2):

    sum = 0
    for a1, b1 in zip(array_1,array_2):
        #  filter out non-return/ inf values
        # max range of lidar is 12 m
        # if a1 < 12 and b1 < 12:
            # print("a1, b1", a1, b1)
            sum = sum + (a1-b1)*(a1-b1)

    return math.sqrt(sum)/len(array_1)

    # return math.sqrt(sum((a1-b1)*(a1-b1) for a1,b1 in zip(array_1,array_2)))/len(array_1)

